import React from "react";
import "./App.css";

import MainSection from "./sections/MainSection/MainSection";
import NavigationBar from "./components/NavigationBar/NavigationBar";

import wildfire from "./assets/wildfire.gif";

function App() {
  return (
    <div>
      <MainSection />
      <div className="">
        <img src={wildfire} />
      </div>
    </div>
  );
}

export default App;
